import {Component, Inject} from '@angular/core';
import {DOCUMENT} from "@angular/common";

@Component({
  selector: 'app-navigation-menu',
  templateUrl: './navigation-menu.component.html',
  styleUrls: ['./navigation-menu.component.css']
})
export class NavigationMenuComponent {
  @Inject(DOCUMENT) document: Document;
}
<nav class="navigation_menu"
>
  <h1 class="logotype-in-navbar"
  >
    <app-logotype-text></app-logotype-text>
  </h1>

  <br *ngIf="document.defaultView.innerWidth < 800"/>

  <div class="menu-items-div"
  >
    <a routerLink="/" class="menu-item">Пользователи</a>
    <a routerLink="/registration" class="menu-item">Регистрация</a>
    <a routerLink="/about" class="menu-item">О проекте</a>
  </div>
</nav>
